DROP TABLE IF EXISTS "public"."report_card";
CREATE TABLE "public"."report_card" (
  "id" int4 NOT NULL DEFAULT nextval('report_card_id_seq'::regclass),
  "created_at" timestamptz(6) NOT NULL,
  "updated_at" timestamptz(6) NOT NULL,
  "name" varchar(254) COLLATE "pg_catalog"."default" NOT NULL,
  "description" text COLLATE "pg_catalog"."default",
  "display" varchar(254) COLLATE "pg_catalog"."default" NOT NULL,
  "dataset_query" text COLLATE "pg_catalog"."default" NOT NULL,
  "visualization_settings" text COLLATE "pg_catalog"."default" NOT NULL,
  "creator_id" int4 NOT NULL,
  "database_id" int4,
  "table_id" int4,
  "query_type" varchar(16) COLLATE "pg_catalog"."default",
  "archived" bool NOT NULL DEFAULT false,
  "collection_id" int4,
  "public_uuid" char(36) COLLATE "pg_catalog"."default",
  "made_public_by_id" int4,
  "enable_embedding" bool NOT NULL DEFAULT false,
  "embedding_params" text COLLATE "pg_catalog"."default",
  "cache_ttl" int4,
  "result_metadata" text COLLATE "pg_catalog"."default",
  "collection_position" int2
)
;
COMMENT ON COLUMN "public"."report_card"."collection_id" IS 'Optional ID of Collection this Card belongs to.';
