INSERT INTO "public"."report_card" VALUES (35, '2021-03-11 14:27:40.075186+08', '2021-03-16 16:21:34.156839+08', '任务执行状态-每日统计', NULL, 'combo', '{"type":"native","native":{"query":"select sd.dtime as 日期, t3.任务执行次数,t3.运行中任务数,t3.成功次数,t3.失败次数 from (select to_char (generate_series ( now() + ''-5 days'', now(),''1 days'' ) ,''yyyy-mm-dd'') as dtime) as sd LEFT JOIN \r\n(select trigger_day, COUNT(handle_code) as 任务执行次数,\r\n\t\t\tCOALESCE(SUM(CASE WHEN (trigger_code in (0, 200) and handle_code = 0) then 1 else 0 end),0) as 运行中任务数, \r\n\t\t\tCOALESCE(SUM(CASE WHEN handle_code = 200 then 1 else 0 end),0) as 成功次数,\r\n\t\t\tCOALESCE(SUM(CASE WHEN handle_code = 200 then 0 else 1 end),0) as 失败次数\r\n\t\t from (select to_char(t1.trigger_time,''yyyy-mm-dd'')  as trigger_day,job_project.name as prj_name, t1.handle_code as handle_code,t1.trigger_code as trigger_code from (SELECT job_log.trigger_time as trigger_time,job_log.handle_code as handle_code,job_log.trigger_code as trigger_code,job_info.project_id as project_id FROM \"job_log\" left join job_info on job_log.job_id= job_info.id)  as t1\r\nleft join job_project on job_project.id = t1.project_id) as t2 GROUP BY trigger_day) as t3 on sd.dtime = t3.trigger_day","template-tags":{}},"database":3}', '{"graph.show_goal":false,"graph.show_trendline":true,"graph.show_values":false,"graph.x_axis.labels_enabled":false,"graph.y_axis.labels_enabled":true,"graph.metrics":["任务执行次数","成功次数","失败次数"],"graph.y_axis.axis_enabled":true,"graph.x_axis.scale":"ordinal","graph.dimensions":["日期"]}', 1, 3, NULL, 'native', 'f', NULL, NULL, NULL, 'f', NULL, NULL, '[{"base_type":"type/Text","display_name":"日期","name":"日期","special_type":null,"fingerprint":{"global":{"distinct-count":6,"nil%":0.0},"type":{"type/Text":{"percent-json":0.0,"percent-url":0.0,"percent-email":0.0,"percent-state":0.0,"average-length":10.0}}}},{"base_type":"type/BigInteger","display_name":"任务执行次数","name":"任务执行次数","special_type":null,"fingerprint":{"global":{"distinct-count":5,"nil%":0