INSERT INTO "public"."report_card" VALUES (1, '2021-01-22 14:26:48.204+08', '2021-03-11 17:06:48.745129+08', 'OMC地址日更新统计', NULL, 'area', '{"type":"native","native":{"query":"select sd.dtime  as 日期,\r\nCOALESCE(st.更新,0) as 修改,\r\nCOALESCE(st.新增,0) as 新增,\r\nCOALESCE(st.删除,0) as 删除\r\nfrom \r\n(select to_char (generate_series (  now() + ''-5 days'', now(),''1 days'' ) ,''mm-dd'') as dtime)\r\nas sd\r\nleft  JOIN\r\n(select to_char(oper_time,''mm-dd'') as 日期,\r\ncount(case when business_type = 2  then oper_time end) as 更新,\r\ncount(case when business_type = 1  then oper_time end) as 新增,\r\ncount(case when business_type = 3  then oper_time end) as 删除\r\nfrom sys_oper_log where sys_oper_log.title=''OMC信息维护'' and status=0 GROUP BY to_char(sys_oper_log.oper_time,''mm-dd''))\r\nas st \r\non st.日期 = sd.dtime","template-tags":{}},"database":2}', '{"graph.x_axis.labels_enabled":false,"table.cell_column":"更新数","graph.x_axis.title_text":"","graph.y_axis.labels_enabled":false,"graph.y_axis.scale":"linear","graph.metrics":["修改"],"graph.y_axis.axis_enabled":true,"table.pivot_column":"count","series_settings":{"更新数":{"color":"#88BF4D","display":"area"},"修改":{"color":"#98D9D9"}},"graph.dimensions":["日期"]}', 1, 2, NULL, 'native', 'f', NULL, NULL, NULL, 'f', NULL, NULL, '[{"base_type":"type/Text","display_name":"日期","name":"日期","special_type":null,"fingerprint":{"global":{"distinct-count":6,"nil%":0.0},"type":{"type/Text":{"percent-json":0.0,"percent-url":0.0,"percent-email":0.0,"percent-state":0.0,"average-length":5.0}}}},{"base_type":"type/BigInteger","display_name":"修改","name":"修改","special_type":null,"fingerprint":{"global":{"distinct-count":1,"nil%":0.0},"type":{"type/Number":{"min":0.0,"q1":0.0,"q3":0.0,"max":0.0,"sd":0.0,"avg":0.0}}}},{"base_type":"type/BigInteger","display_name":"新增","name":"新增","special_type":null,"fingerprint":{"global":{"distinct-count":1,"nil%":0.0},"type":{"type/Number":{"min":0.0,"q1":0.0,"q3":0.0,"max":0.0,"sd":0.0,"avg":0.0}}}},{"base_type":"type/BigInt