INSERT INTO "public"."revision" VALUES (161, 'Card', 1, 1, '2021-01-27 11:34:57.623+08', '{"description":null,"archived":false,"collection_position":null,"table_id":null,"database_id":2,"enable_embedding":false,"collection_id":null,"query_type":"native","name":"OMC地址日更新数","creator_id":1,"made_public_by_id":null,"embedding_params":null,"cache_ttl":null,"dataset_query":{"type":"native","native":{"query":"select sd.dtime  as 日期,COALESCE(st.更新数,0) as 更新数\r\nfrom \r\n(select to_char (generate_series (  now() + ''-5 days'', now(),''1 days'' ) ,''mm-dd'') as dtime)\r\nas sd\r\nleft  JOIN\r\n(select to_char(oper_time,''mm-dd'') as 日期,count(*) as 更新数 from sys_oper_log where sys_oper_log.title=''OMC信息维护'' and sys_oper_log.business_type = 2 and status=0 GROUP BY to_char(sys_oper_log.oper_time,''mm-dd''))\r\nas st \r\non st.日期 = sd.dtime","template-tags":{}},"database":2},"id":1,"display":"area","visualization_settings":{"table.pivot_column":"count","graph.dimensions":["日期"],"graph.metrics":["更新数"],"series_settings":{"更新数":{"color":"#88BF4D","display":"area"}},"graph.y_axis.axis_enabled":true,"graph.x_axis.title_text":"","graph.x_axis.labels_enabled":false,"table.cell_column":"更新数"},"public_uuid":null}', 'f', 'f', NULL);
